import React from "react";
import "./Home.css";
import home_img from './image/home_logo.png';
 function Home(){
    return (
        <div className="row">
            <div className="col-md-6">

            </div>
            <div className="col-md-6">
                <img src={home_img} className='image-fluid'/>
            </div>
        </div>
    );
 }
 export default Home;
